import SeminarCard from "../SeminarCard/SeminarCard";

const SeminarList = ({ seminars, onEdit, onDelete }) => {
  return (
    <div className="seminar-list">
      {seminars.map((seminar) => (
        <SeminarCard
          key={seminar.id}
          seminar={seminar}
          onEdit={onEdit}
          onDelete={onDelete}
        />
      ))}
    </div>
  );
};

export default SeminarList;
